import React from 'react';
import { Text, Button, View, Alert, Image,TouchableOpacity,Switch } from 'react-native';
import { createStackNavigator } from '@react-navigation/stack';
import {styles} from './providerStyle';
import { MaterialCommunityIcons, MaterialIcons, Ionicons } from '@expo/vector-icons';
import AccountMain from './Account/accountMain';
import Resume from './Account/resume';
import Orders from './Account/orders';
import Benefit from './Account/benefit';
import Comment from './Account/comment';
import AccountInfo from './Account/accountInfo';
import ChangePwd from './Account/changePwd';
import Setting from './Account/setting';

export default function Account() {
  const Stack = createStackNavigator();

  return (
    <Stack.Navigator>
      <Stack.Screen name="accountMain" component={AccountMain}/>
    </Stack.Navigator>
  );
}
